from typing import List
class Solution:
    def canCompleteCircuit(self, gas: List[int], cost: List[int]) -> int:
        n=len(gas)
        total_surplus=0
        cur_surplus=0
        start=0

        #print("Estação | Gas | Custo | Diferença | Current Surplus | Total Surplus | Start")
        #print("--------|-----|-------|-----------|-----------------|---------------|------")        

        for i in range(n):
            diff=gas[i]-cost[i]
            total_surplus+=diff
            cur_surplus+=diff

            #print(f"{i:7d} | {gas[i]:3d} | {cost[i]:5d} | {diff:9d} | {cur_surplus:15d} | {total_surplus:13d} | {start:5d}")

            if cur_surplus < 0: #cannot reach next station from current start and also from any station from previous start..i
                start=i+1
                cur_surplus=0
                #print(f"Current Surplus < 0, updating start to {start}")

        result=start if total_surplus>=0 else -1
        #print(f"\nResult: {result}")
        return result



s=Solution()
